<!DOCTYPE html>
<html lang="ja">
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <script src="https://obniz.io/js/jquery-3.2.1.min.js"></script>
  <script src="https://unpkg.com/obniz@1.11.0/obniz.js" crossorigin="anonymous"></script>
<style>
html {
  font-family: sans-serif;
  font-size: 12pt;
}
</style>
</head>
<body>

<div id="obniz-debug"></div>
<h2>SainSmart TFT 1.8" 128x160 pixel LCD</h2>
<hr/>
<div id="panel" disabled>
  <h3>画面の向きに応じてイメージを縮小してLCDへ転送します。</h3>
  <div><img src="https://obniz.io/sdk/parts/SainSmartTFT18LCD/rotate60.png" width="204" height="59"></div>
  <div>LCD向き: <span id="dir">1</span>
    <button name="btnDir" value="0" disabled>0</button>
    <button name="btnDir" value="1" disabled>1</button>
    <button name="btnDir" value="2" disabled>2</button>
    <button name="btnDir" value="3" disabled>3</button>
  </div>
  <div><input id="ufile" type="file" accept="image/jpeg,image/png,image/bmp,image/gif" disabled></div>
  <div style="height:160px;"><canvas id="canvas" width="160" height="128"></canvas></div>
  <div style="font-size:18px"><pre id="img">waiting...</pre></div>
</div>
<div><button id="reload" disabled>reload this page</button></div>
<div><pre id="print"></pre></div>

<script>
'use strict';
var tapORclick = (window.ontouchstart===null) ? "touchstart" : "click";

console.time("start");

var dir = 1;
var date = 0;
var cancelTimer = false;
var obniz = new Obniz("OBNIZ_ID_HERE");
// obniz.debugprint = true;
obniz.onconnect = async function () {

/* pin assign
    VCC    6  5v
    GND    5  gnd
    SCL    4  sclk
    SDA    3  mosi
    DC     2  d/cx
    RES    1  reset
    CS     0  chip select
*/
  let lcd = obniz.wired("SainSmartTFT18LCD", {scl:4, sda:3, dc:2, res:1, cs:0, vcc:6, gnd:5});

  console.time("ready");

  function setDir(dir) {
    dir = dir % 4;
    $("#dir").text(dir);
    lcd.setRotation(dir);
    let canvas = $("#canvas");
    let context = canvas[0].getContext('2d');
    canvas.attr('width', lcd.width);
    canvas.attr('height', lcd.height);
    context.fillStyle = "SeaShell";
    context.fillRect(0, 0, lcd.width, lcd.height);

    context.beginPath();
    context.textAlign = 'center';
    context.textBaseline = 'middle';
    context.fillStyle = 'black';
    let newFont = "24" + context.font.substr(2);
    context.font = newFont;
    context.fillText(dir, lcd.width/2, lcd.height/2, 30);
    context.stroke();
  }

  const bg = lcd.color16(12, 179, 215);
  setDir(dir);
  lcd.fillScreen(bg);
  console.timeEnd("ready");

  lcd.rawBound(0, 40, 160, 39, logo);
  await obniz.wait(1000);

  let logos = [logo2, logo];
  for (let n=0; n<9; n++) {
    let y = Math.floor(Math.random() * 10) * 10;
    setDir(++dir);
    lcd.fillScreen(lcd.color16(12, 179, 215));
    lcd.rawBound(0, y, lcd.width, 39, logos[dir % 2]);
    await obniz.wait(300);
  }

  setDir(1);
  lcd.fillScreen(bg);
  lcd.rawBound(0, 44, 160, 39, logo);
  await obniz.wait(10);
  const msg = 'SainSmart TFT 1.8" LCD\n' + 'collaboration with Obniz.';
  var x = 1, y = 1;
  for (let ch of msg) {
    [x, y] = lcd.drawString(x, y, ch, lcd.color.White, bg);
    await obniz.wait(1);
  }
  await obniz.wait(1000);

  lcd.fillRect(0, 16, 160, 128-16, bg);
  lcd.rawBound(0, 31, 160, 85, obniz_image);
  await obniz.wait(1000);
  lcd.fillRect(37, 31 + 27, 54, 29, lcd.color.Black);
  await obniz.wait(10);

  function dig2(v) {
    return ('0' + v).slice(-2);
  }

  function startClock() {
    date = 0;
    cancelTimer = false;
    setTimeout(function () {
      let timerId = setInterval(function () {
        if (cancelTimer) {
          clearInterval(timerId);
          timerId = 0;
          return;
        }
        let d = new Date();
        let ymd = "'" + dig2(d.getYear() % 100) + "." + dig2(d.getMonth() + 1) + "." + dig2(d.getDate()) + "\n";
        let hms = dig2(d.getHours()) + ":" + dig2(d.getMinutes()) + ":" + dig2(d.getSeconds()) + "\n";
        var x =  0 + 37;
        var y = 31 + 27 + 5;
        if (date != d.getDate()) {
          date = d.getDate();
          lcd.fillRect(x, y, 55, 16, lcd.color.Black);
          lcd.drawString(x, y, ymd, lcd.color.White, lcd.color.White);
        }
        lcd.fillRect(x + 7, y + 8, 54 - 6, 8, lcd.color.Black);
        lcd.drawString(x + 7, y + 8, hms, lcd.color.White, lcd.color.White);
      }, 1000);
    }, 10);
  }

  obniz.switch.onchange = function(state) {
//  $('#print').text(state);
    obniz.display.clear();
    obniz.display.print(state);
  }

  startClock();

  $("button[name='btnDir']").on(tapORclick, async function() {
//  cancelTimer = true;
    dir = parseInt(this.value);
    setDir(dir);
    date = 0;
    lcd.fillScreen(0);
    await obniz.wait(1);
  });

  $(function() {
    $("#ufile").on("change", function() {
      if (!this.files.length) {
        alert('ファイルが選択されていません');
        return;
      }
      cancelTimer = true;
      let file = this.files[0];
      let canvas = $("#canvas");
      let context = canvas[0].getContext('2d');
      let canvasWidth = canvas.attr('width');
      let canvasHeight = canvas.attr('height');

      let image = new Image();
      let fileReader = new FileReader();
      fileReader.onload = function(evt) {
        image.onload = async function() {
          let scale; // 128 x h160 fitting
          let aspectRatio = image.naturalWidth / image.naturalHeight; // 横/縦
          if (aspectRatio > 1.0) {
            // 横長
            scale = lcd.width / image.naturalWidth;
          } else /*if (aspectRatio <= 1.0)*/ {
            // 縦長 or 正方形
            scale = lcd.height / image.naturalHeight;
          }
          let scaledHeight, scaledWidth;
          if (scale < 1) {
            //縮小
            scaledWidth = Math.floor(image.naturalWidth * scale);
            scaledHeight = Math.floor(image.naturalHeight * scale);
          } else {
            //縮小不要
            scaledWidth = image.naturalWidth;
            scaledHeight = image.naturalHeight;
          }
          var x = Math.round((canvasWidth - scaledWidth)/2);
          var y = Math.round((canvasHeight - scaledHeight)/2);
          context.drawImage(image, x, y, scaledWidth, scaledHeight);
          let info = `original size: W${image.naturalWidth} x H${image.naturalHeight} \n` +
            `  scaled size: W${scaledWidth} x H${scaledHeight}`;
          $("#img").text(info);
        
          lcd.fillScreen(0);
          await obniz.wait(1);
          let x1 = parseInt((lcd.width - scaledWidth) / 2);
          let y1 = parseInt((lcd.height - scaledHeight) / 2);
          lcd.drawContextBound(context, x, y, scaledWidth, scaledHeight, x1, y1);

        //setTimeout(startClock, 3000);
        }
        image.src = evt.target.result;
      }
      fileReader.readAsDataURL(file);
    });
  });

  $("#img").text("ready");
  $("button").attr("disabled", false);
  $("input").attr("disabled", false);
  $("#reload").on(tapORclick, function() {
    let result = window.confirm('Reload?\nAre you sure?');
    if (result) {
      location.reload(true);
    }
  });
}
